import React, { Component } from "react";
import { BrowserRouter as Router, Route, Link } from "react-router-dom";

import Beer from "./Components/Beer";

class Home extends Component {
    render() {



        return (
            <Router>
            <div>
              <nav>
                <ul>
                  <li>
                    <Link to="/">Home</Link>
                  </li>
                  <li>
                    <Link to="/beer">Beer</Link>
                  </li>

                </ul>
              </nav>



            </div>
          </Router>
        )
    }
}

export default Home;
